<?php

$stdin='';
while (!feof(STDIN)) $stdin.=fgets(STDIN);
function scan($format){
  global $stdin;
  $out = sscanf($stdin, $format);
  $stdin = substr($stdin, strlen($out[0]));
  return $out;
}
function scantrim(){
  global $stdin;
  $stdin = trim($stdin);
}
function read_sudoku(){
  $t = 9 * 9;
  $out_ = array();
  for ($i = 0 ; $i < $t; $i++)
  {
    $k = 0;
    list($k) = scan("%d");
    scantrim();
    $out_[$i] = $k;
  }
  return $out_;
}

function print_sudoku(&$sudoku_){
  for ($y = 0 ; $y <= 8; $y++)
  {
    for ($x = 0 ; $x <= 8; $x++)
    {
      $u = $sudoku_[$x + $y * 9];
      echo $u;
      echo " ";
      if (($x % 3) == 2)
      {
        echo " ";
      }
    }
    echo "\n";
    if (($y % 3) == 2)
    {
      echo "\n";
    }
  }
  echo "\n";
}

function sudoku_done(&$s){
  for ($i = 0 ; $i <= 80; $i++)
  {
    if ($s[$i] == 0)
    {
      return false;
    }
  }
  return true;
}

